  const { showNav, setShowNav, navMenu } = useContext(NavContext);
  const navMenu1 = () => {
    console.log(showNav);
    setShowNav(false);
  };
  return (
    <AnimatePresence>
      <motion.div className="App">
        <PopupButton
          className={classes.button_card}
          url="https://calendly.com/optimavitallc/test"
          /*
